import React from "react";

import Logo from "../Logo";
import ThemeSwitcher from "../ThemeSwitcher";
import { Header } from "./styles";

function Navbar({ onChangeTheme }) {
  return (
    <Header>
      <Logo />
      <ThemeSwitcher onChange={onChangeTheme} />
    </Header>
  );
}

export default Navbar;
